/* eslint-disable */
import React from 'react';
import MovieCard from './MovieCard';
import './MovieList.css';

const MovieList = props => {
  const { movieList } = props;

  const renderMovieList = () => {
    const renderList = [];

    for (const movie of movieList.results) {
      const { id, title, poster_path, media_type } = movie;

      if (media_type === 'movie' && poster_path != null) {
        renderList.push(
          <MovieCard
            key={id}
            id={id}
            title={title}
            posterPath={poster_path}
          />
        );
      }
    }

    return renderList;
  };

  return (
    <div>
      {movieList.results.length > 0 && (
        <div className="movie-list">{renderMovieList()}</div>
      )}
    </div>
  );
};

export default MovieList;
